import React from 'react'

const Philosophy = () => {
  return (
    <>
        <div className="Philosophy">
            <h2>KM PHILOSOPHY</h2>
            <h6>Your Medical Equipment Experts</h6>
            <p>Quality. Fair Pricing. Exceptional Service. These are the hallmarks under which km medi was established. At km medi, we provide clients with high quality medical equipment at unbeatable prices. Our business was founded in 2023 on the principles of fairness and selection, and we pride ourselves on our commitment to these founding principles to this day</p>
        </div>
    </>
  )
}

export default Philosophy;
